    "Heated Thermoplastic Fiber Placement Head for NASA Langley Research Center Project",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T01:17:03.047558",nt"name": "heated-thermoplastic-fiber-placement-head-for-nasa-langley-research-center-project-2acda",nt"isopen":
    true,nt"url": null,nt"notes": "Reduced mass composite materials are crucial
    to the success of aerospace systems, but are inhibited by expensive autoclave consolidation,
    especially for large parts.  To remedy this, NASA-LaRC has been developing cost-effective
    high-performance thermoplastic composite materials for years.  NASA materials could
    dramatically reduce the cost of large aerospace structures, because those materials
     avoid the autoclave.  However, NASA lacks a robust, cost-effective fabrication
    process to tow-place these emerging materials into laminates, and thus can?t evaluate
    their usefulness to industry.rnrn This program develops for NASA-LaRC the processing
    equipment that allows material evaluation and allows out-of-autoclave fiber placement.
     In particular, this program will deliver a heated in situ deposition head to fit
    on NASA-LaRCs placement machine. Heads can also be sold to industrial companies
    for existing placement machines so that aerospace composites can be fabricated out
    of the autoclave.rnrnIn phase I, the deposition head will be designed and reviewed
    with NASA.  The process window requirements for the placement head for NASA materials
    will be verified.  In phase II, we will complete the design, fabricate, install,
    and prove-out the head equipment.  We then start up the deposition head at NASA
    so that the emerging NASA-LaRC materials can be proven in laminates.rn",nt"license_title":
